import "./../scss/style.scss";
import {Song} from "./Song";

const song1 = new Song("En kvÃ¤ll i juni", "Lasse Berghagen", "Sweden");
const song2 = new Song("Firework", "Katy Perry", "USA");
const song3 = new Song("Nessun dorma", "Luciano Pavarotti", "Italy");

let songs = [song1, song2, song3];

const createSongHtml = () => {
  const songContainer = document.getElementById("songContainer");

  songs.forEach((song) => {
    const songCard = document.createElement("div");
    const songTitle = document.createElement("h3");
    const artistTitle = document.createElement("h4");
    const countryTitle = document.createElement("p");

    songCard.id = "songCard";
    songTitle.className = "songTitle";
    artistTitle.className = "artistTitle";
    countryTitle.className = "contryTitle";

    songTitle.innerHTML = song.name;
    artistTitle.innerHTML = song.artist;
    countryTitle.innerHTML = song.country;

    songCard.appendChild(songTitle);
    songCard.appendChild(artistTitle);
    songCard.appendChild(countryTitle);
    songContainer.appendChild(songCard);
    document.body.appendChild(songContainer);
  });
};
createSongHtml();
import {Foods} from "./foods";

const foodProperties = new Foods("Burritos", "Mexico");
const foodProperties2 = new Foods("Meatballs", "Sweden");
const foodProperties3 = new Foods("Sushi", "Japan");
const foodProperties4 = new Foods("Ceviche", "Peru");
const foodProperties5 = new Foods("Bratwurst", "Germany");

const foodList = [foodProperties, foodProperties2, foodProperties3, foodProperties4, foodProperties5];

console.log(foodProperties);

const foodListContainer = document.createElement("div");
document.body.appendChild(foodListContainer);
foodListContainer.className = "foodListContainer";

const foodListTitle = document.createElement("h2");
foodListContainer.appendChild(foodListTitle);
foodListTitle.innerHTML = "Fooooood!";


for (let i = 0; i < foodList.length; i++) {
  

  const list = document.createElement("ul");
  const foodItems = document.createElement("li");

  
  foodListContainer.appendChild(list);
  list.appendChild(foodItems);

  foodItems.innerHTML = foodList[i].foodOrigin + ": " + foodList[i].foodName;
}

import {Animal} from "./Animal";

const elephant = new Animal(
  "Dumbo",
  "Elefant",
  4,
  "data:image/jpeg;base64,"
);
const ant = new Animal(
  "Worky",
  "Myra",
  6,
  "data:image/jpeg;base64,"
);
const spider = new Animal(
  "Scary",
  "Spindel",
  8,
  "data:image/jpeg;base64,"
);

let animals = [elephant, ant, spider];

const theDiv = document.getElementById("animalContainer");
theDiv.className = "bigContainer";

for (let i = 0; i < animals.length; i++) {
  const div = document.createElement("div");
  div.className = "animalContainer";
  theDiv.appendChild(div);
  const picDiv = document.createElement("div");
  picDiv.className = "picContainer";
  div.appendChild(picDiv);
  const img = document.createElement("img");
  picDiv.appendChild(img);
  img.setAttribute("src", animals[i].picture);
  const title = document.createElement("h1");
  div.appendChild(title);
  title.innerHTML = animals[i].name;
  const type = document.createElement("h3");
  div.appendChild(type);
  type.innerHTML = animals[i].type;
  const pTag = document.createElement("p");
  div.appendChild(pTag);
  pTag.innerHTML = animals[i].name + " har " + animals[i].legs + " antal ben.";
}
